import React from 'react';
import './Products.css';

function Products() {
  return (
    <>
    <div></div>
      <div className='top_bar'>
        <ul>
            <li>Home</li>
            <li>/</li>
            <li>Products</li>
        </ul>
      </div>
    </>
  )
}

export default Products;
